import React from "react";
import PropTypes from "prop-types";
import Link from "next/link";

import { Menu } from "antd";

const AppLayout = ({ children }) => {
  return (
    <div>
      <Menu>
        <Link href="/">
          <a>노드버드</a>
        </Link>
        <Link href="/profile">
          <a>프로필</a>
        </Link>
        <Link href="/signup">
          <a>회원가입</a>
        </Link>
      </Menu>
      {children}
    </div>
  );
};

AppLayout.PropTypes = {
  children: PropTypes.node.isRequired,
};

export default AppLayout;
